import React from 'react';
import axios from 'axios';
import Register from './Register';

class App extends React.Component {
  componentDidMount() {
    this.fetchData();
  }

  onFormSubmit(state) {
    console.log(state.firstname);
    console.log(state.lastname);
    console.log(state.username);
    console.log(state.password);
    console.log(state.confpassword);
  }

  async fetchData() {
    let qs = `?start=1&limit=5000&convert=USD`
    try {
      let res = await axios.get('https://pro-api.coinmarketcap.com/v1/cryptocurrency/listings/latest' + qs, {
        headers: { 'X-CMC_PRO_API_KEY': '9d853d8e-8d5f-46c4-9379-bf571ebfe29e' }
      });
      console.log(res)
      this.setState({
        cryptos: res.data.slice(0, 50)
      });
    } catch (error) {
      console.log(error);
    }
  }


  render() {
    return (
      <div className="outline">
        <h3>Crypto Sim</h3>
        <Register onClickSubmit={this.onFormSubmit} />
      </div>
    );
  }
}

export default App;
